import numpy as np

def submatrix_with_particular_sum(m):
    rows, cols = m.shape
    submatrices = []

    for row in range(rows):
        for col in range(cols):
            for size in range(1, min(rows-row, cols-col)+1):
                submatrix = m[row:row+size, col:col+size]
                if np.sum(submatrix) == -10:
                    submatrices.append(submatrix)

    return submatrices
```
This function will iterate over all possible starting points (row, col) for a submatrix and create submatrices of all possible sizes from that starting point. It will then sum the elements in each submatrix and, if the sum is -10, it will add the submatrix to the list of submatrices to be returned.
